import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { ServicesService } from '../../services/service.service';
import { BatchService } from '../../services/batch.service';
import { BookingService } from '../../services/booking.service';

@Component({
  selector: 'app-book-batch',
  templateUrl: './book-batch.component.html',
  styleUrls: ['./book-batch.component.css']
})
export class BookBatchComponent implements OnInit {

  services: any[] = [];
  batches: any[] = [];
  selectedServiceId: string = "";

  constructor(
      private serviceApi: ServicesService,
      private batchApi: BatchService,
      private bookingApi: BookingService,
      private router: Router
  ) {}

  ngOnInit(): void {
    this.loadServices();
  }

  loadServices() {
    this.serviceApi.getAllServices().subscribe((res: any) => {
      this.services = res;
    });
  }

  loadBatches() {
    if (!this.selectedServiceId) return;

    this.batchApi.getBatchesByService(this.selectedServiceId).subscribe((res: any) => {
      this.batches = res;
    });
  }

  bookBatch(batchId: string) {
    const userId = localStorage.getItem("userId");

    if (!userId) {
      alert("Please login again.");
      this.router.navigate(['/login']);
      return;
    }

    const booking = {
      bookingId: "00000000-0000-0000-0000-000000000000", // Backend will replace
      userId: userId,
      batchId: batchId
    };

    this.bookingApi.createBooking(booking).subscribe({
      next: () => {
        alert("Booking successful!");
        this.router.navigate(['/user/bookings']);
      },
      error: (err) => {
        console.error(err);
        alert("Booking failed. Please try again.");
      }
    });
  }

}
<div class="container py-4">

  <h2 class="page-title text-primary-custom">Book a Batch</h2>

  <!-- Select Service Section -->
  <div class="card card-custom mb-4 p-3">
    <h5 class="fw-bold mb-3">Choose a Service</h5>

    <select class="form-select" [(ngModel)]="selectedServiceId" (change)="loadBatches()">
      <option value="" disabled selected>Select a service</option>
      <option *ngFor="let service of services" [value]="service.serviceId">
        {{ service.name }} - ₹{{ service.price }}
      </option>
    </select>
  </div>

  <!-- Show Available Batches -->
  <div *ngIf="batches?.length > 0">
    <h4 class="fw-bold mb-3">Available Batches</h4>

    <div class="row g-4">
      <div class="col-md-4" *ngFor="let batch of batches">
        <div class="card card-custom p-3 hover-card">

          <h5 class="fw-bold">{{ batch.batchName }}</h5>
          <p class="text-muted mb-1">
            <i class="bi bi-person-badge"></i>
            Instructor: {{ batch.instructor?.name }}
          </p>
          <p class="text-muted mb-1">
            <i class="bi bi-calendar-event"></i>
            Start Date: {{ batch.startDate | date }}
          </p>

          <!-- Book Now Button -->
          <button class="btn btn-primary-custom w-100 mt-2"
                  (click)="bookBatch(batch.batchId)">
            Book Now
          </button>

        </div>
      </div>
    </div>

  </div>

  <!-- No batches found -->
  <div *ngIf="selectedServiceId && batches?.length === 0" class="mt-4 text-center text-muted">
    <i>No batches available for this service.</i>
  </div>

</div>
